import React from "react";
import * as Styled from "./styles";

export const Dashboard = () => {
  const onFormSubmit = () => {};
  return (
    <Styled.Container>
      <form onSubmit={onFormSubmit()}>
        <input placeholder="Company name" />
        <button>Submit</button>
      </form>
    </Styled.Container>
  );
};
